    state->dataDXCoils->DXCoil(HeatCoilIndex).C3Tc = 0.0207;
    state->dataDXCoils->DXCoil(HeatCoilIndex).SC = 5.00;
    state->dataDXCoils->DXCoil(HeatCoilIndex).SupplyFanIndex = 0;

